import axios from "axios";
const url = "http://localhost:8000/product/";

function* getProductFromApi() {
  return axios(url) // It just returns string "1"
    .then((res) => console.log(res))
    .catch((err) => console.log(err));
}

export const Api = {
  getProductFromApi,
};
